import React from 'react'


const VideoContainer = () => {
  return (
    <Box component='div'>
        <Box component='a' href='https://www.pacomartinez.com/es/rebajas.html'>
            <Box component='video' sx={{width:'100%'}}></Box>
        </Box>
        
    </Box>
  )
}

export default VideoContainer
